import React from 'react';
import { AppBar, Toolbar, Typography, Button } from '@mui/material';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Import the CSS file

const Navbar = ({ isLoggedIn }) => {
    return (
        <AppBar position="static" className="AppBar">
            <Toolbar className="Toolbar">
                <Typography variant="h6" className="Navbar-title">
                    <img src={Logo} alt="JD GURUS Logo" style={{ height: '40px', marginRight: '10px' }} />
                    JD GURUS
                </Typography>
                {!isLoggedIn ? (
                    <>
                        <Button color="inherit" component={Link} to="/" className="Navbar-button">Login</Button>
                        <Button color="inherit" component={Link} to="/signup" className="Navbar-button">Signup</Button>
                    </>
                ) : (
                    <>
                        <Button color="inherit" component={Link} to="/dashboard" className="Navbar-button">Dashboard</Button>
                        <Button color="inherit" component={Link} to="/inventory" className="Navbar-button">Inventory</Button>
                        <Button color="inherit" component={Link} to="/barcode-selector" className="Navbar-button">Barcode Selector</Button>
                        <Button color="inherit" component={Link} to="/label-printer" className="Navbar-button">Label Printer</Button>
                    </>
                )}
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
